import styled from "styled-components";

const Wrapper = styled.div`
  background: red;
  text-align: center;
  margin: 0 auto;
  height: 100vh;
`;

const Index = () => {
  return (
    <>
      <Wrapper>
      <h1>HOLA</h1>
        </Wrapper>
    </>
  );
};

export default Index;
